'''Bush patches''' are a [[Farming]] patch in which players can grow bushes that yield berries. Planting a bush requires using '''one''' bush seed on any patch. With the exception of [[poison ivy berries]], bushes are also susceptible to [[disease (Farming)|disease]].

When fully grown, its health must be checked before harvesting. Like [[fruit tree]]s, [[calquat tree]]s and [[cactus|cacti]], bushes will continue to produce after harvesting. To remove a bush, use a [[spade]] on it to dig it up after harvesting. The yield scales with [[Farming]] level, with the minimum always being four unless harvested again before it has regrown all berries (within approximately 80 minutes).

